<?xml version="1.0" encoding="utf-8" ?>
<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN"
        "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd">
<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="" lang="">
<head>
  <title>剑鱼论坛UI自动化测试报告 - Suites</title>
  <meta http-equiv="Content-Type" content="text/html;charset=utf-8" />
  <meta name="description" content="TestNG unit test results." />
  <link href="reportng.css" rel="stylesheet" type="text/css" />
  <script type="text/javascript" src="reportng.js"></script>
</head>
<body style="margin-top: 0;">

<div id="sidebarHeader">
  <h2>剑鱼论坛UI自动化测试报告</h2>
  <p>
    <a href="overview.html" target="main">Overview</a>
  </p>
</div>
<table id="suites">
  <thead>
    <tr>
      <th class="header suite" onclick="toggleElement('tests-${velocityCount}', 'table-row-group'); toggle('toggle-${velocityCount}')">
        <span id="toggle-${velocityCount}" class="toggle">&#x25bc;</span>jianyutest
      </th>
    </tr>
  </thead>
  <tbody id="tests-${velocityCount}" class="tests">

        <tr>
      <td class="test">
          <span class="successIndicator" title="All tests passed.">&#x2714;</span>
        <a href="suite${suiteId}_test${velocityCount}_results.html" target="main">jytest</a>
      </td>
    </tr>
  </tbody>
</table>
</body>
</html>
